import React, { Component } from 'react';
import { Bar } from 'react-chartjs-2'
import 'chartjs-plugin-annotation'

class BarChart extends React.Component {
  state = {
    data: [20, 10]
  }

  render(){

    return(
      <Bar
         data={this.state.data}
       />
     )
   }
}
export default BarChart;
